import { Link } from "react-router-dom";
export default function Card(props) {
   return (
      <div className="card" key={props.id}>
         <button onClick={() => props.onClose(props.id)}>X</button>
         <h2>{props.name}</h2>
         <h2>{props.status}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.origin.name}</h2>
         <img src={props.image} alt='' />
      </div>
   );
}
